import { useState } from "react";

export default function Dashboard() {
    const [currentPage, setCurrentPage] = useState("settings");

    return (
        <div class="flex flex-row w-screen h-screen bg-[#2a2a2a]">
            <div class = "flex w-64 h-screen bg-red-100">
            
            </div>
            <div class = "flex w-5/6 h-screen bg-green-100">
                <div class = "flex flex-col w-full h-screen bg-green-100">
                    <div class = "flex h-24 h-screen bg-yellow-100">
                    
                    </div>
                    <div class = "flex h-full h-screen bg-blue-100 p-8">
                        <div class = "flex w-full h-full bg-red-400">

                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
